// DropdownMenu.js

import React from 'react';

const Home = () => {
  const options = [
    'Option 1',
    'Option 2',
    'Option 3',
    'Option 4',
    'Option 5',
    'Option 6',
    'Option 7',
    'Option 8',
    'Option 9',
    'Option 10',
  ];

  return (
    <div>
      <input list="options" name="options" placeholder="Search or select an option" />
      <datalist id="options">
        {options.map((option, index) => (
          <option key={index} value={option} />
        ))}
      </datalist>
    </div>
  );
};

export default Home;
